// src/Table.js
function TableHeader() {
    return (
      <thead>
        <tr>
          <th>Name</th>
          <th>Job</th>
        </tr>
      </thead>
    );
}

function TableBody() {
    return (
        <tbody/>
);
}

function Table(props) {
    return (
        <table>
        <TableHeader />
        <TableBody characterData={props.characterData}/>
        </table>
);
}

export default Table;
